import React from 'react'

export default function customer(props) {

    function customerProfile(){
        return(
            <div>
                <image src={props.img} alt='Proflie'/>
        <h2>{props.name}({props.id})</h2>

            </div>
        )
    }


    return (
      <div>
          <customerProfile/>
        <p>{props.birth}</p>
        <p>{props.gender}</p>
        <p>{props.job}</p>
      </div>
    );


}
